import React from 'react'
import {SearchOutlined, Notifications} from '@material-ui/icons'
import {Grid} from '@material-ui/core'

const CardMovie = () => {
  return (
    <Grid container spacing={2}>
        <Grid xs={12} sm={12} md={12} lg={12} xl={12} item>
          <div className="img-movie-div">
            <img src="https://asset.kompas.com/crops/2vpXZ8VEtMW84mrg5hEzb3tFRF8=/0x0:791x527/750x500/data/photo/2017/11/05/1132136128.jpeg" className="img-movie" />
          </div>
        </Grid>
        <Grid xs={12} sm={12} md={12} lg={12} xl={12} item>
          <div>
            <p>Movie</p>
          </div>
        </Grid>
        <style jsx>{`
          .container-CardMovie {
                display: flex;
                flex-direction:column;
          }
          .img-movie-div {
            height : 200px;
            width : 100px;
            border-radius: 10px;

          }


            .icon-header {
                font-size:25px;
                font-color:#5a5a5a;
            }
            .search {
                margin-right:50px;
            }
          `}</style>
    </Grid>
  )
}
export default CardMovie
